description:
Juno MacGuff ar 16 och lever ett till synes bekymmerslost liv, tills ett oonskat plus pa en plaststicka skakar om hennes varld radikalt. Plotsligt har den lilla ungen en annu mindre dito att tanka pa, och i takt med att hennes mage vaxer lar hon sig ocksa allt mer om vad det innebar att vara vuxen och ta ansvar....


I rollerna:  Jennifer Garner,Ellen Page,Michael Cera,Jason Bateman,J.K. Simmons 


